import React from "react";
import "../../src/main.css";

const btnPrueba = () => {
  alert("Diste click si..");
};
const BUTTON = () => {
  return (
    <button onClick={btnPrueba} className="btn">
      ENVIAR
    </button>
  );
};

export default BUTTON;
